import React from "react";
import "./App.css";
import { useState } from "react/cjs/react.production.min";
const App = () => {
  const add = () => {
    count++;
    console.log(count);
  };
  const less = () => {
    count--;
    console.log(count);
  };
  const state=useState(1);
  let count=state[0];
  let setCount=state[1];
  
  return (
    <div className="app">
      <h1>{count}</h1>
      <button onClick={less}>-</button>
      <button onClick={add}>+</button>
    </div>
  );
};
export default App;
